import React from "react";
import { JobExperience } from "./jobExperience";
import { PersonalInformation } from "./personalInformation";

export class ContentDisplay extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      FirstName: null,
      SecondName: null,
      Age: null,
      Country: null,
      Position: null,
      Company: null,
      Duration: null,
    };
  }

  handleCallback = childData => {
    this.setState({ FirstName: childData });
  };

  handleCallback2 = childData2 => {
    this.setState({ SecondName: childData2 });
  };

  handleCallback3 = childData3 => {
    this.setState({ Age: childData3 });
  };

  handleCallback4 = childData4 => {
    this.setState({ Country: childData4 });
  };

  handleCallbackExperience = childDataExperience => {
    this.setState({ Position: childDataExperience });
  };

  handleCallbackExperience2 = childDataExperience2 => {
    this.setState({ Company: childDataExperience2 });
  };

  handleCallbackExperience3 = childDataExperience3 => {
    this.setState({ Duration: childDataExperience3 });
  };

  render() {
    const { FirstName, SecondName, Age, Country } = this.state;
    const { Position, Company, Duration } = this.state;
    return (
      <div>
        <header className="TopBar">
          <h1>CV-APLICATION</h1>
        </header>
        <section className="inputsGetValueSectionDisplay">
          <section className="PersonalInformation">
            <h1>PersonalInformation</h1>

            <PersonalInformation
              parentCallback={this.handleCallback}
              parentCallback2={this.handleCallback2}
              parentCallback3={this.handleCallback3}
              parentCallback4={this.handleCallback4}
            />
          </section>
          <section className="jobExperience">
            <h1>Job Experience</h1>
            <JobExperience
              parentCallbackExperience={this.handleCallbackExperience}
              parentCallbackExperience2={this.handleCallbackExperience2}
              parentCallbackExperience3={this.handleCallbackExperience3}
            />
          </section>
          <section className="education">
            <h1>Education</h1>
          </section>
        </section>
        <footer>
          <section className="displayInputsTopBar">
            <h1>Your CV</h1>
          </section>
          <section className="displayInputsPersonalInformation">
            <section>
              <h2>Your name</h2>
              {FirstName}
            </section>
            <section>
              <h2>Your SecondName</h2>
              {SecondName}
            </section>
            <section>
              <h2>Your Age</h2>
              {Age}
            </section>
            <section>
              <h2>Your Country</h2>
              {Country}
            </section>
          </section>
          {/*space*/}
          <section className="displayInputsJobExperience">
            <section>
              <h2>Your Position</h2>
              {Position}
            </section>
            <section>
              <h2>Companys Name</h2>
              {Company}
            </section>
            <section>
              <h2>The Duration</h2>
              {Duration}
            </section>
          </section>
        </footer>
      </div>
    );
  }
}
